import React from "react";
import NavBar2 from "../components/NavBar2";

function Landing() {
  return (
    <>
      <NavBar2 />
      <section className="flex w-full flex-col">
        <img src="https://trello.com/1/cards/66739ee859f217efa639df63/attachments/66890d15493ce8feea25cf62/previews/66890d16493ce8feea25d06c/download/Logo_1-01.png" />
      </section>
    </>
  );
}

export default Landing;
